import { Link } from "react-router-dom";
import "./Nav.scss";

function Nav() {
  return (
    <div className="nav">
      <Link className="nav__link" to="/">
        Home
      </Link>
      <Link className="nav__link" to="/cats">
        Meows List
      </Link>
      <Link className="nav__link" to="/cats/add">
        Upload Meows
      </Link>
    </div>
  );
}
export default Nav;
